- input: '"TEXT","F3XN","C00033134","Please note the following explanations for the
    adjustments on the Schedule D:    Marriott Denver Tech Center:  This debt was
    due to a food and beverage minimum provision in a contract for meeting space.  The
    provision was to be met by another affiliated organization that was utilizing
    a portion of the meeting space, but who subsequently cancelled at the last minute
    and the Party was left to pay for the unincurred minimum food and beverage bill.  The
    Vendor agreed to not hold the Party liable for this unincurred amount due to the
    cancellation of the affiliated organization.    Lexis Nexis:  This amount of this
    debt was due to an error on the part of the Vendor.  The Party requested the account
    be closed in April.  The Vendor however continued to bill through September.  After
    researching the cancellation of the Party the Vendor agreed to the account closure
    in April and adjusted the bill accordingly.    Siler Printing:  The contract entered
    into with the Vendor stated that the work would be done by a particular date.  The
    work was not completed and the Party had to retain other Vendors to complete the
    work.  The Vendor agreed to this and therefore adjusted the bill accordingly."'
